"use strict";function handleStudent(e){e.preventDefault();try{var t=e.target.elements,r=t.name,a=t.age,n=t.studentID,u=t.averageGrade,r=r.value,a=a.valueAsNumber,n=n.valueAsNumber,u=u.valueAsNumber;axios.put("/addStudent",{name:r,age:a,studentID:n,averageGrade:u}).then(function(e){var t=e.data;console.log(t)}),alert("Submitted Succesfuly!"),e.target.reset()}catch(e){console.error(e)}}var firstForm=document.querySelector(".firstForm");function handleStudentSearchQuery(e){try{e.preventDefault();var t=document.querySelector(".holder"),r=e.target.children.searchQuery.valueAsNumber;axios.get("/getStudentQuery?id=".concat(r)).then(function(e){var t=e.data;console.log(t)}),e.target.reset(),axios.get("/getStud").then(function(e){return t.innerHTML=e.data.html})}catch(e){console.error(e)}}firstForm.addEventListener("submit",handleStudent);var secondForm=document.querySelector(".secondForm");function handleStudentSearchParam(e){e.preventDefault();try{var t=document.querySelector(".holder"),r=e.target.children.searchParam.valueAsNumber;axios.get("/getStudentParam/".concat(r)).then(function(e){var t=e.data;console.log(t)}),e.target.reset(),axios.get("/getStud").then(function(e){return t.innerHTML=e.data.html})}catch(e){console.error(e)}}secondForm.addEventListener("submit",handleStudentSearchQuery);var thirdForm=document.querySelector(".thirdForm");thirdForm.addEventListener("submit",handleStudentSearchParam);